// src/components/Section1.js
import React from 'react';
import './section1.css';

function Section1({ content }) {
  return (
    <div className="section">
      <h2>Section 1</h2>
      <h1>Welcome to the Gender Reveal Game</h1>
      <p>This is where you can customize your message:</p>
      <p>Your custom message goes here.</p>
    </div>
  );
}

export default Section1;
